snippet.description:
Udacity, a pioneer in online education, is building "University by Silicon Valley", a new type of online university that:
- teaches the actual programming skills that industry employers need today;
- delivers credentials endorsed by employers, because they built them;
- provides education at a fraction of the cost and time of traditional schools.

With industry giants - Google, AT&T, Facebook, Salesforce, Cloudera, etc. - we offer Nanodegree credentials, designed so professionals become Web Developers, Data Analysts, or Mobile Developers. Supported by our communities of coaches and students, our students learn programming and data science through a series of online courses and hand-on projects that help them practice and build a convincing portfolio.

